import { Route, Switch } from 'react-router-dom';
import Slidbar from './Components/Sidbar'
import Home from './pages/Home'
import About from './pages/About'

function App() {
  return (
    <div className="flex ">
      {/*Slider Bar */}
      <div className="w-0 sm:w-0 lg:w-20">
        <div className="flex-shrink-0 h-screen overflow-hidden bg-primary shadow-nav">
          <Slidbar />
        </div>
      </div>

 {/*Route all of pages*/}
      <div className="w-full ">
        <div className="h-screen overflow-y-auto bg-orange-500 ">
          <Switch>

            <Route exact path='/' component={Home} />
            <Route exact path='/about' component={About} />

          </Switch>
        </div>
      </div>

    </div>
  );
}

export default App;
